import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Bulk Data Exfiltration Simulation ---

    // 1. Exfiltrate all link texts and hrefs from the page
    // This simulates a crawler scraping all available navigation paths.
    await page.waitForSelector('a', { timeout: 5000 });
    const allLinks = await page.$$eval('a', links =>
      links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      })).filter(link => link.text) // Filter out empty links
    );

    // 2. Exfiltrate all category card information
    // This simulates scraping key business categories or product groups.
    await page.waitForSelector('.category-card', { timeout: 5000 });
    const categoryCards = await page.locator('.category-card').allTextContents();
    const cleanedCategories = categoryCards.map(text => text.replace(/\s+/g, ' ').trim());

    // 3. Exfiltrate user-specific section data
    // This simulates targeting divs that contain sensitive user information summaries.
    await page.waitForSelector('div.returns-orders', { timeout: 5000 });
    const returnsAndOrdersText = await page.locator('div.returns-orders').textContent();

    await page.waitForSelector('div.cart', { timeout: 5000 });
    const cartText = await page.locator('div.cart').textContent();

    // 4. Exfiltrate all button texts
    // This simulates gathering all possible actions a user can take.
    const allButtons = await page.$$eval('button', buttons =>
        buttons.map(btn => btn.textContent.trim()).filter(text => text)
    );

    // Take a screenshot after gathering data (page state is unchanged visually)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_gathered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_gathered.png'));

    const extractedData = {
      linkCount: allLinks.length,
      categoryCount: cleanedCategories.length,
      buttonCount: allButtons.length,
      allLinks: allLinks.slice(0, 20), // Truncate for readability
      categories: cleanedCategories,
      buttons: allButtons,
      userDataSnippets: {
        returnsOrders: returnsAndOrdersText.trim(),
        cart: cartText.trim()
      }
    };

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all links, categories, buttons, and user data snippets.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
